   "source": [
    "<a id=\"Models\"></a>\n",
    "# Models\n",
    "\n",
    "For this part I chose to build four models. Three simple ones: logistic regression, naïve bayes and decision trees. And one a bit more complex: random forest.\n",
    "\n",
    "Null values where already dropped in a previous cell. Also, categorical variables have already been converted to R factors. Apart from this no more explicit preprocessing was done in this notebook to keep it simple and easy to follow.\n",
    "\n",
    "To compare the models we first divide the dataset in a training set with 70% of instances and a test set with the rest of the instances. And this taking into account that the distribution of the target has to be the same in both sets.\n",
    "\n",
    "The test set mimics data in the real world, it will only be used at the end of the project to get a more robust measure of the models on unseen data.\n",
    "\n",
    "The training set will be used to evaluate the models via 10 fold cross-validation. For simplicity, we'll leave the hypeparameter selection of the models by default, this means that some random combinations will be chosen and the models will be trained via cross-validation for each combination, keeping the hiperparameter combination that gave the best result."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 19,
   "metadata": {
    "_kg_hide-input": true,
    "_kg_hide-output": true,
    "execution": {
     "iopub.execute_input": "2022-05-23T02:20:10.112891Z",
     "iopub.status.busy": "2022-05-23T02:20:10.111827Z",
     "iopub.status.idle": "2022-05-23T02:20:10.143762Z"
    }
   },
   "outputs": [],
   "source": [
    "set.seed(8)\n",
    "training_indeces <- createDataPartition(data$target, p = .7, list = FALSE)\n",
    "data.train <- data[ training_indeces,]\n",
    "data.test  <- data[-training_indeces,]\n",
    "\n",
    "# 10 fold Cross-validation\n",
    "fitControl <- trainControl(method=\"cv\", number=10)"
   ]
  },
